import { combineReducers } from "redux";
import Batreducer from "./redux/bat/Batreducer";
import BallReducer from "./redux/ball/ballreducer";

// merged store 
const rootReducer = combineReducers({
    Ball: BallReducer,
    Bat: batreducer
})

export default rootReducer;
